import React from 'react';
import ReactDom from 'react-dom';
import './index.css'

let cdate = new Date();
let hrs = cdate.getHours;
var message = hrs
if(hrs>0 && hrs<12 )
{
    message="Good Morning its:"+hrs;
}
else if(hrs>=12 && hrs<17)
{
    message="Good Afternoon its:"+hrs;
}
else if(hrs>=17 && hrs<19)
{
    message="Good Afternoon its:"+hrs;
}
else if(hrs>=19 && hrs<=24){
    message="Good Night its:"+hrs;
}

ReactDom.render(
<>
<h1>Hello Ajay..{message}</h1>
</>,
document.getElementById('root')
);
